We are getting close to the start of our 12 Minis in 12 Months event and wanted to introduce ourselves. 🎉

I'm Kristina and am really excited to be joining the 12 Minis in 12 Months team for 2023. I live in Alaska with my husband and four kids. My sewing interests range from quilting to foundation paper piecing to bag making. If I'm not spending time with my family or sewing, you'll probably find me taking a nap. 😆

Follow #12minisin12months2023 to meet the other designers and sew along with us next year. And visit all the designers profiles from the list below! 

For the event, you can buy each pattern separately from the designer on their website when their month comes. Or you can buy the bundle of all the patterns right now through 12minis.com! The bundle is currently on sale for just a few more weeks, at the start of the year the price will go up! 

